import React from "react"
import "./VideoList.css"

import VideoItem from "./VideoItem";

const VideoList = props => {
    const videos = props.videos.map(video => {
        return <ImageCard key={video.id} />
    })
    return (
        <div>{videos}</div>
    )
}

export default VideoList
